const idleCallback=window.requestIdleCallback||window.requestAnimationFrame;function preload2(){const a=Array.prototype.slice.call(document.getElementsByTagName('a')||[]);a.map(a=>{a.addEventListener('mouseenter',function(b){const a=this.href;!this.hasAttribute('preloaded')&&(a.startsWith("https://andrewconner.com")||a.startsWith("https://andrewconner.github.io")||a.startsWith("http://localhost"))&&idleCallback(()=>{const c=document.getElementById('prerenderLink');if(this.setAttribute('preloaded',1),c)c.href!==a&&(c.href=a);else{var b=document.createElement('link');b.id="prerenderLink",b.rel="prefetch prerender",b.href=a,document.head.appendChild(b)}})})})}document.addEventListener('DOMContentLoaded',function(){idleCallback(preload2)})